import { useState } from "react";

export default function Board() {

  function Square({ value }) {

    function handleClick() {
      console.log('Clicked!');
    }

    return <button 
      className="square"
      onClick={ handleClick }>
        { value }
      </button>;
  }

  return (
    <>
      <div className="board-row">
        <Square value="1"/>
        <Square value="1"/>
        <Square value="1"/>
      </div>
      <div className="board-row">
        <Square />
        <Square />
        <Square />
      </div>
      <div className="board-row">
        <Square />
        <Square />
        <Square />
      </div>
    </>
  );
}
